import React from "react";
import Fullpage, {
  FullPageSections,
  FullpageNavigation,
  FullpageSection,
} from "@ap.cx/react-fullpage";
import HomeConts2 from "./HomeConts2";
import HomeConts3 from "./HomeConts3";
import HomeConts4 from "./HomeConts4";
import { Route, Routes } from "react-router-dom";

const HomeConts1 = () => {
  return (
    <div>
      <Fullpage>
        <FullpageNavigation />
        <FullPageSections>
          <FullpageSection>
            <h1>Section1</h1>
          </FullpageSection>
          <HomeConts2 />
          <HomeConts3 />
          <HomeConts4 />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<HomeConts2 />} />
            <Route path="/projects" element={<HomeConts3 />} />
            <Route path="/contact" element={<HomeConts4 />} />
          </Routes>
        </FullPageSections>
      </Fullpage>
    </div>
  );
};

export default HomeConts1;
